import React, {Component} from 'react';
import ps5 from '../PS5.jpeg'
import xbox from '../XBOX.jpg'

import {Container, Row, Col, Image} from "react-bootstrap";

class Home extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row>
                        <Col xs={4} md={7}>
                            <Image src={ps5} width="300"  rounded/>
                        </Col>
                    </Row>

                    <Row>
                        <Col xs={6} md={7}>
                            <Image src={xbox} width="500" rounded/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Home;
